import React from 'react';
import Toilets from '../components/Toilets'
import { Col, Row, Card } from 'react-bootstrap';


function Wc() {
    return (
        <Card style={{ border: "3px #138086 solid", padding: '0px', margin: "0px" }}>
            <Row>
                <Col><Toilets /></Col>
            </Row>
        </Card>
    );
}

export default Wc;
